const INITIAL_STATE = {
    modulos: [],
    cargando: false
};

export default (state = INITIAL_STATE, action) => {
    switch (action.type) {
        case 'traer_modulos':
            return { ...state, modulos: action.payload }
        case 'crear_modulo':
            return {
                ...state,
                modulos: action.payload
            }
        case 'editar_modulo':
            return {
                ...state,
                modulos: action.payload
            }
        case 'eliminar_modulo':
            return {
                ...state,
                modulos: action.payload
            }
        default:
            return state;
    }
}
